import React from 'react';
import { useTable } from 'react-table';
import { table, Container} from '../components/table.style';

const EmployeeList = () => {
    return (
        <> 
        <Container>
            <h1>List of Employees</h1>
        <table>
            <thead>
                <tr>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Gender</th>
                    <th>Sex</th>
                    <th>Email</th>
                    <th>Status</th>
                </tr>

            </thead>
        </table>
        </Container>
        </>
    )
}
export default EmployeeList;
